import { useState } from "react"
import { Link, Outlet } from "react-router-dom"
import pic1 from '../pic/pic1.png'
import pic2 from '../pic/pic2.png'

import pic3 from '../pic/pic3.png'
const List=()=>{
    const [mypersons,setmypersons]=useState([
        {name:"rachel",age:12,pic:pic1},
      ,     {name:"sara",age:5,pic:pic2},
          {name:"naomi",age:82,pic:pic3}
    ])
    return <>{mypersons.map(l=><p><Link to={`myditailes/${l.age}/${l.pic}`} key={l.name}><img src={l.pic}></img></Link><br/></p>)}
    <Outlet></Outlet>
    </>
}
export default List
